import React from 'react'
import Router from 'next/router'

export default function Auth () {

    const handleBack = () => {
        Router.push('/')
    }

    return (
        <React.Fragment>
            Auth
            <button onClick={handleBack}>Go back</button>
        </React.Fragment>
    )
}
